def distance(v1,v2):
    result=0
    for i in range(len(v1)):
        result=result+pow(v1[i]-v2[i],2)
    
    return result

def compresion(im,dic,size=512,b=8):
    imdec=deconstruir(im,size,b)
    imres=[]
    for dvec in imdec:
        dist=distance(imdec[0],dvec)
        imres.append(0)
        for i in range(1,size):
            tmpdist=distance(imdec[i],dvec)
            if tmpdist<dist:
                dist=tmpdist
                imres[len(imres)-1]=i
    return imres
    
def decompresion(imd,dic,size=512,b=8):
    tmpim=[]
    for i in imd:
        tmpim.append(dic[i])
    #print("tmpim: ")
    #print(tmpim)
    im=construir(tmpim,size,b)
    plt.figure()    
    plt.imshow(im, cmap=plt.cm.gray)
    plt.show()
    return (im,tmpim)
    

